import React from 'react'
import logo from '../src/images/Vector-Smart-Object11.png'
import './header.css'
import {Link} from 'react-router-dom'



function header() {
   function ontime(){
    let text= document.querySelector=("navtexts")
    if(text.length >1)
    document.querySelector=("navtexts").style.co
   }
  return (
    <div className='navbar' >

     <div className='logo'>
     <img src={logo} className='image-logo' alt=''></img>
     </div>
     <div className='nav-text'>
      
        <Link className='link-header' to ='/'>        <p  onClick={ontime}   className='navtexts'>HOME</p></Link>
        <Link className='link-header'  to='/aboutus'> <p  onClick={ontime}  className='navtexts'>ABOUT</p></Link>
        <Link className='link-header' to ='/services'><p  onClick={ontime}  className='navtexts'>SERVICES</p></Link>
        <Link className='link-header' to='/contactus'><p  onClick={ontime}  className='navtexts'>CONTACT US</p></Link>
        
        
        </div>

       </div>
  
   
  

  )
}

export default header
